import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from '../frontend/components/components/HomePage';
import BooksPage from './components/BooksPage';
import BookDetailsPage from './components/BookDetailsPage';
import AddBookForm from './components/AddBookForm';
import EditBookForm from './components/EditBookForm';
import AuthorsPage from './components/AuthorsPage';
import AuthorDetailsPage from './components/AuthorDetailsPage';
import AddAuthorForm from './components/AddAuthorForm';
import EditAuthorForm from './components/EditAuthorForm';

const App = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/" component={HomePage} />
          <Route exact path="/books" component={BooksPage} />
          <Route exact path="/books/add" component={AddBookForm} />
          <Route exact path="/books/:book_id" component={BookDetailsPage} />
          <Route exact path="/books/:book_id/edit" component={EditBookForm} />
          <Route exact path="/authors" component={AuthorsPage} />
          <Route exact path="/authors/add" component={AddAuthorForm} />
          <Route exact path="/authors/:author_id" component={AuthorDetailsPage} />
          <Route exact path="/authors/:author_id/edit" component={EditAuthorForm} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
